import ItemStyles from './styles/ItemStyles';
import Title from './styles/Title';

const Product = ({ product }) => (
  <ItemStyles>
    <img
      src={product?.photo?.image?.publicUrlTransformed}
      alt={product?.name}
    />
    <Title>{product?.name}</Title>
  </ItemStyles>
);

export default Product;
